import styled from "styled-components";
import { motion, useAnimation } from "framer-motion";

const EditProfileComponentStyle = styled(motion.div)``;
const DashbordEditProfileComponent = ({ controller }) => {
  return (
    <EditProfileComponentStyle animate={controller}></EditProfileComponentStyle>
  );
};
export default DashbordEditProfileComponent;
